import React, { Component } from 'react'


export default class Page extends Component {
    constructor(){
        super();
        this.input =React.createRef();
    }
    handlekey = (event) => {
        if(event.key === 'Enter'){
            console.log('worked')
        }

        let inputWord = this.input.current.value;
        console.log(inputWord)
    };

    render() {
        const words = [
            'one',
            'two',
            'three'
        ];


    return (
      <div>
        {words.map(item =>{
            return <h1>{item}</h1>
        })}
        <input type='text' onKeyPress={ this.handlekey } ref={this.input} />
      </div>
    )
  }
}

